import { BrowerRouter as Router, Routes, Route } from 'react-router-dom';
import Following from './pages/Following';
import Home from './pages/Home';

function App() {
  return (
    <Router>
      <div className='App'>
        <Switch>
          <Route path="/" element={<Home />} />
          <Route path="/following" element={<Following />} />
        </Switch>
      </div>
    </Router>
  )
}
export default App;
